import React from 'react'
import HeaderContent from "./Components/HeaderContent";
import Introduction from "./Components/Introduction";
import LogicMachine from "./Components/LogicMachine";
import Multilevel from "./Components/Multilevel";
import PuzzleRideles from "./Components/PuzzleRideles";
import Rational from "./Components/Rational";
import Advance from "../Components/Advance";
import CompetitveGames from "./Components/CompetitveGames";

function Home() {
    return (
        <div>
            <HeaderContent />
          <Introduction item="1" />
          <Rational item="2" />
          <PuzzleRideles item="3" />
          <Multilevel item="4" />
          <CompetitveGames item="5" />
          <LogicMachine item="6" />
          <Advance item="7" />
        </div>
    )
}

export default Home
